import React, { useState } from "react";
import "bootstrap/dist/css/bootstrap.css";

import { Nav, Navbar, Container } from "react-bootstrap";

function Navigation() {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        justifyContent: "center",
        backgroundColor: "#b39cd0",
        fontFamily: "Zen Tokyo Zoo",
      }}
    >
      <Navbar expand="lg" bg="transparent">
        <Container style={{ display: "flex",gap: "20px"}}>
          <Navbar.Toggle />
          <Navbar.Collapse>
            <Nav className="fs-3">
              <Nav.Link style={{ color: "#fff" }}>Home</Nav.Link>
              <Nav.Link style={{ color: "#fff" }}>About</Nav.Link>
              <Nav.Link style={{ color: "#fff" }}>Contact</Nav.Link>
              <Nav.Link style={{ color: "#fff" }}>Sign In</Nav.Link>
            </Nav>
          </Navbar.Collapse>
        </Container>
      </Navbar>
    </div>
  );
}

export default Navigation;
